import React, { useEffect } from "react";
import CatCard from "./CatCard";

function MatchPage({matched, setMatch, cats}) {

    useEffect(() => {
        const matchedArray = cats.filter((cat) => {
            if(cat.id === matched.id) {
                return cat
            }
        })
        setMatch(matchedArray)
    }, [])

    return (
        <div>
              {matchedArray.map((cat) => (
                          <CatCard 
                              id={cat.id}
                              image={cat.url}
                              name={cat.name}
                              favoritemovie={cat.favoriteMovie}
                              age={cat.age}
                              pickupLine={cat.pickupLine}
                              matched={matched} 
                              setMatch={setMatch}
                          />
          ))}
        </div>
    ) 
}

export default MatchPage
